header {
  z-index: 1;
  background-color: #372e4c;
  box-shadow: 0 0.5rem 2rem 0 rgba(0, 0, 0, 0.37);
  justify-content: space-between;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  width: 100%;
  padding: 0 1rem;
  box-sizing: border-box;
}
@media (min-width: 768px) {
  header {
    padding: 0 1.5rem;
    align-items: end;
    position: sticky;
    top: 0;
  }
}
@media (min-width: 1280px) {
  header {
    flex-direction: row;
    padding: 0 2rem;
  }
}

ul .li-spaced, ol .li-spaced {
  margin-bottom: 1rem;
  margin-top: 1rem;
}
ul p, ul ul, ul ol, ol p, ol ul, ol ol {
  margin: 0;
}

main {
  margin: 0 auto;
  padding: 0 1rem;
}
@media (min-width: 768px) {
  main {
    padding: 0 1.5rem;
  }
}
@media (min-width: 1280px) {
  main {
    padding: 0 2rem;
  }
}

.nav {
  width: 100%;
  display: none;
}
@media (min-width: 768px) {
  .nav {
    display: contents;
  }
}
.nav--mobile {
  display: flex;
  justify-content: center;
  width: 100%;
}
@media (min-width: 768px) {
  .nav--mobile {
    display: none;
  }
}
.nav__list, .nav__list--mobile {
  display: flex;
  justify-content: end;
  gap: 2rem;
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}
.nav__list--mobile {
  display: block;
  width: 100%;
}
.nav__item, .nav__item--mobile {
  list-style: none;
  text-align: center;
}
.nav__item--mobile {
  display: flex;
  align-items: center;
  justify-content: center;
}
.nav__link, .nav__link--mobile, .nav__link--mobile:hover, .nav__link--active, .nav__link:hover, .nav__link--active:hover {
  background-color: transparent;
  color: #9170f9;
  font-style: normal;
  font-weight: bold;
  min-width: 10%;
  box-sizing: border-box;
  height: 100%;
  padding: 1rem;
  display: flex;
  align-items: center;
}
@media (min-width: 768px) {
  .nav__link, .nav__link--mobile, .nav__link--mobile:hover, .nav__link--active, .nav__link:hover, .nav__link--active:hover {
    padding: 1.5rem;
  }
}
@media (min-width: 1280px) {
  .nav__link, .nav__link--mobile, .nav__link--mobile:hover, .nav__link--active, .nav__link:hover, .nav__link--active:hover {
    padding: 2rem;
  }
}
.nav__link--active, .nav__link:hover, .nav__link--mobile:hover, .nav__link--active:hover {
  border-bottom: #9170f9 solid 0.125rem;
}
.nav__link--mobile:hover {
  border: none;
  color: #ffffff;
}

.site-logo {
  aspect-ratio: 16/9;
  max-width: 10rem;
}

.hamburger {
  align-self: center;
  width: calc(100% - 10rem);
  display: flex;
  justify-content: end;
}
@media (min-width: 768px) {
  .hamburger {
    display: none;
  }
}
.hamburger__bar {
  display: block;
  width: 1.5625rem;
  height: 0.1875rem;
  margin: 0.3125rem auto;
  transition: all 0.3s ease-in-out;
  background-color: #6649f5;
  border-radius: 1rem;
}
.hamburger__bar-container.active .hamburger__bar:nth-child(2) {
  opacity: 0;
}
.hamburger__bar-container.active .hamburger__bar:nth-child(1) {
  transform: translateY(0.5rem) rotate(45deg);
}
.hamburger__bar-container.active .hamburger__bar:nth-child(3) {
  transform: translateY(-0.5rem) rotate(-45deg);
}

.hidden {
  display: none;
}

.color-text {
  color: #ffffff;
  font-style: italic;
}

.underline {
  text-decoration: underline;
  font-weight: bold;
  color: #c4acfd;
}

.documentation {
  background-color: #372e4c;
  padding: 1rem;
  margin-top: 1rem;
  border-radius: 1rem;
  margin-left: auto;
  margin-right: auto;
}
@media (min-width: 768px) {
  .documentation {
    max-width: 60%;
    padding: 1.5rem;
  }
}
@media (min-width: 1280px) {
  .documentation {
    max-width: 50%;
    padding: 2rem;
  }
}
